import React from 'react';
import { NavLink } from 'react-router-dom';

const Nav = () => {
    return (
        <nav>
            <ul>
                <li></li><NavLink to="/about">About</NavLink>
            </ul>       
        </nav> 
    );
};

export default Nav;
